import './App.css';
import Shop from './components/Shop/Shop'
import QuestionsAns from './components/QuestionsAns/Questionwithans'


function App() {
  const questions = ['How react works?', 'Props vs State'];
  const answers = ['React.js is a javaScript library to create a single-page app ui. It is used to manage the view layer for devices. If there are numerous state changes, React does not commit them sequentially. React walks through its virtual DOM, makes a list of the modifications that need to be applied to the real DOM, and afterwards performs everything in one go.', ans2];
  return (
    <div className="App">
      <h1>Welcome to Laptop House</h1>
      <Shop></Shop>

      <div className='ques'>
        <QuestionsAns questions={questions} answers={answers}></QuestionsAns>

      </div>
    </div>

  );
}

export default App;
